import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { LoginComponent } from './pantallas/login/login.component';
import { RegistroComponent } from './pantallas/registro/registro.component';
import { RecuperaContraComponent } from './pantallas/recupera-contra/recupera-contra.component';


const routes: Routes = [
  { path: '', component: LoginComponent , pathMatch: 'full'},
  { path: 'login', component: LoginComponent , pathMatch: 'full'},
  { path: 'registro', component: RegistroComponent},
  { path: 'recuperaContra', component: RecuperaContraComponent}


];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
